pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {IERC1155} from "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import {IERC721} from "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract WareHouse is AccessControl {
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    mapping(address => bool) public blackListWallet;
    mapping(address => bool) public tokenDeposit;

    address public POOL = 0x6020b60099D623608987Bbd9dcFeE61fC06BBB89;

    event DEPOSIT_EVENT_1155(
        address user,
        address nft,
        uint256 nft_id,
        uint256 amount,
        uint256 timestamp
    );
    event DEPOSIT_EVENT_721(
        address user,
        address nft,
        uint256 nft_id,
        uint256 timestamp
    );
    event DEPOSIT_TOKEN_EVENT(
        address user,
        address token,
        uint256 amount,
        uint256 timestamp
    );

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function depositNFT1155(
        address _nft,
        uint256 _nftId,
        uint256 _amount
    ) public {
        require(!blackListWallet[msg.sender], "you are blacklist");

        emit DEPOSIT_EVENT_1155(
            msg.sender,
            _nft,
            _nftId,
            _amount,
            block.timestamp
        );
        IERC1155(_nft).safeTransferFrom(
            msg.sender,
            POOL,
            _nftId,
            _amount,
            "0x00"
        );
    }

    function depositNFT721(address _nft, uint256 _nftId) public {
        require(!blackListWallet[msg.sender], "you are blacklist");

        emit DEPOSIT_EVENT_721(msg.sender, _nft, _nftId, block.timestamp);
        IERC721(_nft).safeTransferFrom(msg.sender, POOL, _nftId);
    }

    function depositToken(address _token, uint256 _amount) public {
        require(!blackListWallet[msg.sender], "you are blacklist");
        require(tokenDeposit[_token], "token can not deposit");
        emit DEPOSIT_TOKEN_EVENT(msg.sender, _token, _amount, block.timestamp);
        IERC20(_token).transferFrom(msg.sender, POOL, _amount);
    }

    function setTokenDeposit(address _token, bool _result) public {
        require(
            hasRole(DEFAULT_ADMIN_ROLE, msg.sender) ||
                hasRole(ADMIN_ROLE, msg.sender),
            "not have permission"
        );
        tokenDeposit[_token] = _result;
    }

    function setPool(address _address) public {
        require(
            hasRole(DEFAULT_ADMIN_ROLE, msg.sender) ||
                hasRole(ADMIN_ROLE, msg.sender),
            "not have permission"
        );
        POOL = _address;
    }

    function setBlackListWallet(address[] memory wallets, bool result) public {
        require(
            hasRole(DEFAULT_ADMIN_ROLE, msg.sender) ||
                hasRole(ADMIN_ROLE, msg.sender),
            "not have permission"
        );
        for (uint i = 0; i < wallets.length; i++) {
            blackListWallet[wallets[i]] = result;
        }
    }

    function clearUnknownToken(address _tokenAddress) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "not have permission");
        uint256 contractBalance = IERC20(_tokenAddress).balanceOf(
            address(this)
        );
        IERC20(_tokenAddress).transfer(address(msg.sender), contractBalance);
    }
}
